import Body from "../Body/Body"
import Navbar from "../Header/Navbar/Navbar"
import "./Geral.css";

const Geral = () => {
    return (
        <div className="Geral">
            <Navbar/>
            <Body/>
        </div>
    )
}

export default Geral;
